import Home from './VIEWS/HOME/home';
import Landing from './VIEWS/LANDING/landing';
import { Route } from 'react-router-dom';



function App() {
  return (
  <div className="App">
    <Route exact path='/' element={<Landing/>}></Route>
    <Route path='/home' component={Home}><Home/></Route>

  </div>
  );
}

export default App;
